import * as React from 'react';
import JqxPanel from 'jqwidgets-scripts/jqwidgets-react-tsx/jqxpanel';
import JqxInput, { IInputProps } from 'jqwidgets-scripts/jqwidgets-react-tsx/jqxinput';

class dvlogin extends React.Component<{}, IInputProps> {
    constructor(props: {}) {
            super(props);
            this.state = {
            source: ["Afghanistan"]
        }
    }

    public render() {
        return (
            <JqxPanel width={350} height={350} >
                <div style={{ margin: '10px' }}>
                    <h1>Not Logged In</h1>
                    <JqxInput
                        width={200} height={25} source={this.state.source}
                     minLength={1} placeHolder={'Enter a Country'} />
                </div>
            </JqxPanel>
        );
    }
}
export default dvlogin;
